export const findSvgElements = (element) => {
    const svgElements = element.querySelectorAll('svg');
    const composables = [];
    Array.from(svgElements).forEach((svgElement) => {
        const svg = svgElement;
        composables.push({
            type: 'svg',
            element: svg,
        });
    });
    return composables;
};
